import React from "react";
import { ChatState } from "../Context/ChatProvider";
import Box from "@mui/material/Box";

const ChatBox = () => {
  const { selectedChat } = ChatState();
  return (
    <Box
      display="flex"
      alignItems="center"
      flexDirection="column"
      backgroundColor="white"
      padding="3px"
      color="black"
      width="100%"
    >
      Single Chat
    </Box>
  );
};

export default ChatBox;
